import React from 'react';

interface RadioFrutaProps {
  register: any;
  sabores: string[];
}

const RadioFruta: React.FC<RadioFrutaProps> = ({ register, sabores }) => {
  return (
    <div id='sabor' className='itens'>
      {sabores.map((sabor, index) => (
        <div key={index} id={`sabor_${sabor.toLowerCase()}`}>
          <label>{sabor}</label>
          <input {...register("sabor")} type="radio" value={sabor} />
        </div>
      ))}
    </div>
  );
};

export default RadioFruta;
